/* Procedure structure for procedure `insertIndexData` */

/*!50003 DROP PROCEDURE IF EXISTS  `insertIndexData` */;

DELIMITER $$

/*!50003 CREATE PROCEDURE `insertIndexData`(
index_type_id int,
companyName_in varchar(200),
LTP_in double,
change_in DOUBLE,
volume_in bigint,
buyPrice_in DOUBLE,
sellPrice_in DOUBLE,
buyQty_in DOUBLE,
sellQty_in DOUBLE
)
BEGIN

	
	DECLARE companyId INT;
	
	
	
		Select id into companyId from `indexcompany` where `companyName` =  companyName_in and `indexType`=index_type_id;
		
		insert into `indexdata` (`companyId`,`LTP`,`change`,`volume`,`buyPrice`,`sellPrice`,`buyQty`,`sellQty`)
		values(companyId,LTP_in,change_in ,volume_in ,buyPrice_in ,sellPrice_in ,buyQty_in ,sellQty_in );


	END */$$
